import {put, takeEvery} from 'redux-saga/effects';
import {REGISTER_USER, REGISTER_USER_SUCCESS, registerUserSuccess} from '../actions/auth_actions';
import { api } from '../api';

export function* registerUser(action) {
    console.log(action);
    const reply = api.registerUser(action)
    try {
        registerUserSuccess(action)
    } catch (e) {
        console.log('bad')
    }
}

export function* auth() {
    yield takeEvery(REGISTER_USER, registerUser)
  }
